import React from "react";
import { SearchBox } from "./styled";

interface IMovieSearchBar {}

const MovieSearchBar: React.FC<IMovieSearchBar> = () => {
  return (
    <>
      <SearchBox type="text" placeholder="Search Movies" />
    </>
  );
};

export default MovieSearchBar;
